import React, { Component } from 'react';
import DocumentTypeForm from './forms/DocumentTypeForm';
import PurchaseTypeForm from './forms/PurchaseTypeForm';
import Option from './Option';
import './controlpanel.css';

class ControlPanel extends Component {

  	handleClick(val) {
  	  	alert('hola');
  	}
  	render() {
  	  	return (  	  		  
  	  		  <div id="ContentPaneldeControl" className="EstiloIconosMenuDashboard" ostype="desktop">
                <div className="titulo">Maestros</div>
                <ul>
                    Option tab="pestana0" titulo='Administracion Tipos de Compra' icono="shopping-cart" funcionClick={this.props.funcionClick} componente="PurchaseType" />  
                    <li onClick={this.handleClick.bind(this)}>
                        <div className="icono"><i className="material-icons">assignment_turned_in</i></div>
                        <div className="data"></div>
                    </li>
            
                    <li>
                        <div className="icono"><i className="material-icons">widgets</i></div>
                        <div className="data">Administracion Tipos de Documento</div>
                    </li>
            
                    <li>
                        <div className="icono"><i className="material-icons">assignment_turned_in</i></div>
                        <div className="data">Administracion de Usuarios</div>
                    </li>
                </ul>            
                <div className="titulo">Configuraciones</div>
                <ul>
                    <li>
                        <div className="icono"><i className="material-icons">event_busy</i></div>
                        <div className="data"> Calendario de dias Festivos </div>
                    </li>
            
                </ul>
            </div> 	
  	  	);
  	}
}

export default ControlPanel
